      destinations: [
        'Cape Town',
        'Livingstone',
        'Okavango',
        'Rio De Jenario'
      ]
    },
    {
      id: '000-000-0000-0002',
      name: 'Jasmine',
      email: 'jas@venanciogomani.net',
      phone: 766935959,
      destinations: [
        'Sydney',
        'Monte Carlo',
        'Munich',
        'Barcelona'
      ]
    }
  ];
  constructor() {}

  ngOnInit(): void {
    //
  }
}
